(function ($) {
    function loadDepartment(){
        $.each(ubigeo, function(i,value) {
            if(value.departamento != "00" && value.provincia == "00" && value.distrito == "00"){
                $('#department').append('<option value="'+value.departamento+'">'+value.nombre+'</option>');
            }
        });
    }
    function loadProvince(de){
        $.each(ubigeo, function(i,value) {
            if(value.departamento == de && value.provincia != "00" && value.distrito == "00"){
                $('#province').append('<option value="'+value.provincia+'">'+value.nombre+'</option>');
            }
        });
    }
    function loadDistrict(de,pr){
        $.each(ubigeo, function(i,value) {
            if(value.departamento == de && value.provincia == pr && value.distrito != "00"){
                $('#district').append('<option value="'+value.distrito+'">'+value.nombre+'</option>');
            }
        });
    }
    $('#department').on('change', function(){
        $('#province').empty();
        $('#province').append('<option value="">Selecciona</option>');
        $('#district').empty();
        $('#district').append('<option value="">Selecciona</option>');
        var dep = $(this).val();
        loadProvince(dep);
    });
    $('#province').on('change', function(){
        $('#district').empty();
        $('#district').append('<option value="">Selecciona</option>');
        var dep = $('#department').val();
        var pro = $(this).val();
        loadDistrict(dep,pro);
    });
    loadDepartment();

}(jQuery));;
